import React, {Component} from 'react';









class File extends Component{


    method(name2){
        return <span> {name2} </span> 
    }


    render(){


       // const name= "Raghad"
//const name2 = this.method("Alahmadi")

        return(
            <h1>{this.props.name}{this.props.name2}</h1>
            
        )
    }
}

export default File
